import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import { Doughnut } from "react-chartjs-2";
import GaugeChart from "react-gauge-chart";
import { ErrorBoundary } from 'react-error-boundary'
ChartJS.register(ArcElement, Tooltip, Legend);

interface DoughnutModelProps {
  values: number[];
  labels: string[];
}

interface GaugeModelProps {
  value: number;
  label: string;
  levelCount: number;
  arcLengths: number[];
}

interface GaugeProps {
  val1?: number;
  val2?: number;
  val3?: number;
  unit1?: string;
  unit2?: string;
  unit3?: string;
}

interface MeterProps {
  value: number;
  max: number;
}




export function Meter(props: MeterProps) {
  return (
    <GaugeChart
      id="gauge-chart1"
      nrOfLevels={200}
      percent={props.value / props.max}
      animate={true}
      animateDuration={2000}
      textColor="#000"
      colors={['#5BE12C', '#F5CD19', '#EA4228']}
      arcsLength={[0.3, 0.5, 0.2]}
    />
  )
}

interface ErrorFallbackProps {
  error: Error;
  resetErrorBoundary: () => void;
}

function ErrorFallback({ error, resetErrorBoundary }: ErrorFallbackProps) {
  return (
    <div role="alert">
      <p>Something went wrong:</p>
      <pre>{error.message}</pre>
      <button onClick={resetErrorBoundary}>Try again</button>
    </div>
  )
}


const gaugeStyle = {
  maxWidth: "20vw",
  height: 250,
}


export const data = {
  datasets: [
    {
      label: '# of Votes',
      data: [12, 19, 3, 5, 2, 3],
      backgroundColor: [
        'rgba(255, 99, 132, 0.2)',
        'rgba(54, 162, 235, 0.2)',
        'rgba(255, 206, 86, 0.2)',
        'rgba(75, 192, 192, 0.2)',
        'rgba(153, 102, 255, 0.2)',
        'rgba(255, 159, 64, 0.2)',
      ],
      borderColor: [
        'rgba(255, 99, 132, 1)',
        'rgba(54, 162, 235, 1)',
        'rgba(255, 206, 86, 1)',
        'rgba(75, 192, 192, 1)',
        'rgba(153, 102, 255, 1)',
        'rgba(255, 159, 64, 1)',
      ],
      borderWidth: 1,
    },
  ],
};

const options = {
  responsive: true,
}

export function DoughnutModels({ values, labels }: DoughnutModelProps) {
  const data = {
    labels,
    datasets: [
      {
        label: 'Dataset 1',
        data: values,
        backgroundColor: ['rgba(255, 99, 132, 0.5)',
          'rgba(54, 162, 235, 0.5)',
          'rgba(255, 206, 86, 0.5)',
        ],
      },
    ],
  };
  return (
    <Doughnut data={data} options={options} width={300} height={300} />
  );
}


// export function GaugeModels({ value, levelCount, label, arcLengths }: GaugeModelProps) {

export function GaugeModels(props: GaugeProps) {
  return (
    <div style={{
      display: "flex",
      flexDirection: "row",
      alignItems: "center",
      justifyContent: "flex-start",
    }}>
      {props.val1 &&
        <div style={gaugeStyle}>
          {/* <ErrorBoundary FallbackComponent={ErrorFallback} > */}
          <Meter value={props.val1} max={100} />
          {/* </ErrorBoundary> */}

        </div>
      }
      {
        props.val2 &&
        <div style={gaugeStyle}>
          {/* <Meter value={props.val2} max={100} /> */}
        </div>
      }
      {
        props.val3 &&
        <div style={gaugeStyle}>
          {/* <Meter value={props.val3} max={100} /> */}
        </div>
      }
    </div >
  );
}
